BEGIN TRANSACTION;
DROP TABLE IF EXISTS "cars";
CREATE TABLE "cars" (`id` integer,`created_at` datetime,`updated_at` datetime,`deleted_at` datetime,`car_no_plate` text,`car_type` text,`transporter` text,`tank_capacity` integer,`json_compartments` JSON,`license_expiration_date` text,`calibration_expiration_date` text,`tank_license_expiration_date` text,`car_license_image_name` text,`calibration_license_image_name` text,`car_license_image_name_back` text,`calibration_license_image_name_back` text,`tank_license_image_name` text,`tank_license_image_name_back` text,`is_in_trip` numeric,`is_approved` numeric,`location` text,`latitude` text,`longitude` text,`last_fuel_odometer` integer,`last_oil_change_id` integer,driver_id INTEGER,etit_car_id TEXT,`location_time_stamp` text,`engine_status` text,`speed` integer,PRIMARY KEY (`id`),CONSTRAINT `fk_cars_driver` FOREIGN KEY (`driver_id`) REFERENCES `drivers`(`id`));
DROP TABLE IF EXISTS "drivers";
CREATE TABLE `drivers` (`id` integer,`created_at` datetime,`updated_at` datetime,`deleted_at` datetime,`name` text,`mobile_number` text,`id_license_expiration_date` text,`driver_license_expiration_date` text,`safety_license_expiration_date` text,`drug_test_expiration_date` text,`transporter` text,`is_approved` numeric,`is_in_trip` numeric,`criminal_record_image_name` text NOT NULL DEFAULT "",`id_license_image_name` text NOT NULL DEFAULT "",`driver_license_image_name` text NOT NULL DEFAULT "",`safety_license_image_name` text NOT NULL DEFAULT "",`drug_test_image_name` text NOT NULL DEFAULT "",`id_license_image_name_back` text NOT NULL DEFAULT "",`driver_license_image_name_back` text NOT NULL DEFAULT "",`social_security_no` text,PRIMARY KEY (`id`));
DROP TABLE IF EXISTS "expenses";
CREATE TABLE "expenses" (`id` integer,`created_at` datetime,`updated_at` datetime,`deleted_at` datetime,`trip_struct_id` integer,`cost` real,`description` text,`date` text,`driver_id` integer, `category` text, `payment_method` text, `is_paid` numeric NOT NULL DEFAULT false,PRIMARY KEY (`id`),CONSTRAINT `fk_trip_structs_expenses` FOREIGN KEY (`trip_struct_id`) REFERENCES `trip_structs`(`id`),CONSTRAINT `fk_drivers_expenses` FOREIGN KEY (`driver_id`) REFERENCES `drivers`(`id`));
DROP TABLE IF EXISTS "fcm_tokens";
CREATE TABLE `fcm_tokens` (`id` integer,`created_at` datetime,`updated_at` datetime,`deleted_at` datetime,`value` text,PRIMARY KEY (`id`));
DROP TABLE IF EXISTS "fee_mappings";
CREATE TABLE `fee_mappings` (`id` integer,`created_at` datetime,`updated_at` datetime,`deleted_at` datetime,`company` text,`terminal` text,`drop_off_point` text,`distance` real,`fee` real, `latitude` real, `longitude` real, `osrm_distance` real,PRIMARY KEY (`id`));
DROP TABLE IF EXISTS "final_struct_responses";
CREATE TABLE `final_struct_responses` (`id` integer,`created_at` datetime,`updated_at` datetime,`deleted_at` datetime,`trip_struct_id` integer,`mileage` real,`driver_fees` real,PRIMARY KEY (`id`),CONSTRAINT `fk_trip_structs_route` FOREIGN KEY (`trip_struct_id`) REFERENCES `trip_structs`(`id`));
DROP TABLE IF EXISTS "fuel_events";
CREATE TABLE `fuel_events` (`id` integer,`created_at` datetime,`updated_at` datetime,`deleted_at` datetime,`car_id` integer,`car_no_plate` text,`driver_name` text,`date` text,`liters` real,`price_per_liter` real,`price` real,`fuel_rate` real,`transporter` text,`odometer_before` integer,`odometer_after` integer,`excel_index` integer,`excel_index_expenses` integer, `time` text, `method` text,PRIMARY KEY (`id`));
DROP TABLE IF EXISTS "land_marks";
CREATE TABLE `land_marks` (`id` integer,`created_at` datetime,`updated_at` datetime,`deleted_at` datetime,`name` text,`latitude` text,`longitude` text,PRIMARY KEY (`id`));
DROP TABLE IF EXISTS "loans";
CREATE TABLE "loans" (`id` integer,`created_at` datetime,`updated_at` datetime,`deleted_at` datetime,`trip_struct_id` integer,`amount` real,`method` text,`date` text,`driver_id` integer, `is_paid` numeric NOT NULL DEFAULT false,PRIMARY KEY (`id`),CONSTRAINT `fk_trip_structs_loans` FOREIGN KEY (`trip_struct_id`) REFERENCES `trip_structs`(`id`),CONSTRAINT `fk_drivers_loans` FOREIGN KEY (`driver_id`) REFERENCES `drivers`(`id`));
DROP TABLE IF EXISTS "locations";
CREATE TABLE "locations" (
	"id"	INTEGER,
	"created_at"	datetime,
	"updated_at"	datetime,
	"deleted_at"	datetime,
	"name"	TEXT,
	"address"	TEXT
);
DROP TABLE IF EXISTS "oil_changes";
CREATE TABLE "oil_changes" (`id` integer,`created_at` datetime,`updated_at` datetime,`deleted_at` datetime,`car_id` integer,`car_no_plate` text,`driver_name` text,`super_visor` text,`date` text,`mileage` real,`odometer_at_change` real,`current_odometer` real,`excel_index` integer,`transporter` text,`cost` real,PRIMARY KEY (`id`));
DROP TABLE IF EXISTS "other_routes";
CREATE TABLE `other_routes` (`id` integer,`created_at` datetime,`updated_at` datetime,`deleted_at` datetime,`terminal_id` integer,`location_id` integer,`fee_rate` real,PRIMARY KEY (`id`));
DROP TABLE IF EXISTS "petro_app_records";
CREATE TABLE `petro_app_records` (`id` integer,`created_at` datetime,`updated_at` datetime,`deleted_at` datetime,`branch` text,`vehicle_id` integer,`vehicle` text,`show_vehicle_profile` numeric,`internal_id` text,`structure_no` text,`trip_number` text,`fuel_type_title` text,`cost` text,`cost_inc_vat` text,`service_fee` text,`service_fee_inc_vat` text,`number_of_liters` text,`odo` integer,`delegate_id` integer,`delegate_name` text,`date` text,`station` text,`station_branch` text,`lat` real,`lng` real,`vehicle_plate_image` text,`fuel_pump_image` text,`odometer_image` text,`vat_percent` text,`total_before_vat` text,`vat_amount` text,`customer_name` text,`customer_commercial_no` text,`customer_tax_no` text,`customer_post_code` text,`station_name` text,`station_commercial_no` text,`station_tax_no` text,`station_address` text,`address` text,`second_address` text,`mobile` text,`whatsapp` integer,`email` text,`petroapp_vat_number` text,`petroapp_name` text,`kilometers_per_liter` text,`liters_per100_kilometer` text,`fuel_source_title` text,`company_address` text,`payment_status` text,`is_synced` numeric,PRIMARY KEY (`id`));
DROP TABLE IF EXISTS "petro_app_stations";
CREATE TABLE `petro_app_stations` (`id` integer,`created_at` datetime,`updated_at` datetime,`deleted_at` datetime,`name` text,`lat` real,`lng` real,PRIMARY KEY (`id`));
DROP TABLE IF EXISTS "route_points";
CREATE TABLE `route_points` (`id` integer,`created_at` datetime,`updated_at` datetime,`deleted_at` datetime,`final_struct_response_id` integer,`latitude` text,`longitude` text,`time_stamp` text,PRIMARY KEY (`id`),CONSTRAINT `fk_final_struct_responses_points` FOREIGN KEY (`final_struct_response_id`) REFERENCES `final_struct_responses`(`id`));
DROP TABLE IF EXISTS "salaries";
CREATE TABLE `salaries` (`id` integer,`created_at` datetime,`updated_at` datetime,`deleted_at` datetime,`driver_id` integer,`driver_cost` real,`total_expenses` real,`total_loans` real,`start_date` text,`close_date` text,PRIMARY KEY (`id`));
DROP TABLE IF EXISTS "services";
CREATE TABLE `services` (`id` integer,`created_at` datetime,`updated_at` datetime,`deleted_at` datetime,`car_id` integer,`car_no_plate` text,`driver_name` text,`service_type` text,`date_of_service` text,`odometer_reading` integer,`transporter` text,`excel_index` integer,`super_visor` text,`cost` real,`proof_image_name` text,PRIMARY KEY (`id`));
DROP TABLE IF EXISTS "speed_alerts";
CREATE TABLE "speed_alerts" (`id` integer,`created_at` datetime,`updated_at` datetime,`deleted_at` datetime,`vehicle_id` text,`plate_no` text,`speed` integer,`timestamp` text,`parsed_time` datetime,`latitude` text,`longitude` text,`exceeds_by` integer,`alerted_admin` numeric,`hash` text,PRIMARY KEY (`id`));
DROP TABLE IF EXISTS "taqa_routes";
CREATE TABLE `taqa_routes` (`id` integer,`created_at` datetime,`updated_at` datetime,`deleted_at` datetime,`terminal_id` integer,`location_id` integer,`distance` real,PRIMARY KEY (`id`));
DROP TABLE IF EXISTS "terminals";
CREATE TABLE "terminals" (
	"id"	INTEGER,
	"created_at"	datetime,
	"updated_at"	datetime,
	"deleted_at"	datetime,
	"name"	TEXT,
	"address"	TEXT
, `latitude` real, `longitude` real);
DROP TABLE IF EXISTS "tire_positions";
CREATE TABLE `tire_positions` (`id` integer,`created_at` datetime,`updated_at` datetime,`deleted_at` datetime,`truck_id` integer,`position_type` text,`position_index` integer,`side` text,`tire_id` integer,PRIMARY KEY (`id`),CONSTRAINT `fk_trucks_positions` FOREIGN KEY (`truck_id`) REFERENCES `trucks`(`id`),CONSTRAINT `fk_tire_positions_tire` FOREIGN KEY (`tire_id`) REFERENCES `tires`(`id`));
DROP TABLE IF EXISTS "tires";
CREATE TABLE "tires" (`id` integer,`created_at` datetime,`updated_at` datetime,`deleted_at` datetime,`serial` varchar(100),`brand` text,`size` text,`manufacture_date` text,`purchase_date` text,`status` text,PRIMARY KEY (`id`));
DROP TABLE IF EXISTS "trip_structs";
CREATE TABLE `trip_structs` (`id` integer,`created_at` datetime,`updated_at` datetime,`deleted_at` datetime,`car_id` integer,`driver_id` integer,`car_no_plate` text,`driver_name` text,`transporter` text,`tank_capacity` integer,`pick_up_point` text,`progress_index` integer,`step_complete_time_db` JSON,`no_of_drop_off_points` integer,`date` text,`fee_rate` real,`start_time` text,`end_time` text,`mileage` real,`driver_fees` real,`is_closed` numeric,`receipt_no` text,`company` text, `revenue` real,PRIMARY KEY (`id`));
DROP TABLE IF EXISTS "trip_summaries";
CREATE TABLE `trip_summaries` (`id` integer,`created_at` datetime,`updated_at` datetime,`deleted_at` datetime,`final_struct_response_id` integer,`total_mileage` text,`total_active_time` text,`total_passive_time` text,`total_idle_time` text,`numberof_stops` text,`total_dis_connected_time` text,`sensor1` text,`sensor2` text,PRIMARY KEY (`id`),CONSTRAINT `fk_final_struct_responses_trip_summary` FOREIGN KEY (`final_struct_response_id`) REFERENCES `final_struct_responses`(`id`));
DROP TABLE IF EXISTS "trips";
CREATE TABLE `trips` (`id` integer,`created_at` datetime,`updated_at` datetime,`deleted_at` datetime,`car_id` integer,`driver_id` integer,`car_no_plate` text,`driver_name` text,`transporter` text,`tank_capacity` integer,`company` text,`terminal` text,`drop_off_point` text,`location_name` text,`capacity` integer,`gas_type` text,`date` text,`revenue` real,`mileage` real,`receipt_no` text,PRIMARY KEY (`id`));
DROP TABLE IF EXISTS "trucks";
CREATE TABLE "trucks" (`id` integer,`created_at` datetime,`updated_at` datetime,`deleted_at` datetime,`truck_no` varchar(50),`make` text,`year` integer,PRIMARY KEY (`id`));
DROP TABLE IF EXISTS "users";
CREATE TABLE `users` (`id` integer,`name` text,`email` text UNIQUE,`password` blob,`permission` integer,`IsApproved` integer,PRIMARY KEY (`id`));
DROP TABLE IF EXISTS "vendor_expenses";
CREATE TABLE `vendor_expenses` (`id` integer,`created_at` datetime,`updated_at` datetime,`deleted_at` datetime,`vendor_id` integer NOT NULL,`description` text NOT NULL,`price` real NOT NULL,PRIMARY KEY (`id`),CONSTRAINT `fk_vendors_expenses` FOREIGN KEY (`vendor_id`) REFERENCES `vendors`(`id`));
DROP TABLE IF EXISTS "vendor_transactions";
CREATE TABLE `vendor_transactions` (`id` integer,`vendor_id` integer NOT NULL,`date` datetime NOT NULL,`description` text NOT NULL,`amount` real NOT NULL,`created_at` datetime,`updated_at` datetime,`deleted_at` datetime,PRIMARY KEY (`id`),CONSTRAINT `fk_vendors_transactions` FOREIGN KEY (`vendor_id`) REFERENCES `vendors`(`id`));
DROP TABLE IF EXISTS "vendors";
CREATE TABLE "vendors" (`id` integer,`created_at` datetime,`updated_at` datetime,`deleted_at` datetime,`name` text NOT NULL,`contact` text,`notes` text,PRIMARY KEY (`id`));
DROP INDEX IF EXISTS "idx_cars_deleted_at";
CREATE INDEX `idx_cars_deleted_at` ON `cars`(`deleted_at`);
DROP INDEX IF EXISTS "idx_drivers_deleted_at";
CREATE INDEX `idx_drivers_deleted_at` ON `drivers`(`deleted_at`);
DROP INDEX IF EXISTS "idx_expenses_deleted_at";
CREATE INDEX `idx_expenses_deleted_at` ON `expenses`(`deleted_at`);
DROP INDEX IF EXISTS "idx_fcm_tokens_deleted_at";
CREATE INDEX `idx_fcm_tokens_deleted_at` ON `fcm_tokens`(`deleted_at`);
DROP INDEX IF EXISTS "idx_fee_mappings_deleted_at";
CREATE INDEX `idx_fee_mappings_deleted_at` ON `fee_mappings`(`deleted_at`);
DROP INDEX IF EXISTS "idx_final_struct_responses_deleted_at";
CREATE INDEX `idx_final_struct_responses_deleted_at` ON `final_struct_responses`(`deleted_at`);
DROP INDEX IF EXISTS "idx_fuel_events_deleted_at";
CREATE INDEX `idx_fuel_events_deleted_at` ON `fuel_events`(`deleted_at`);
DROP INDEX IF EXISTS "idx_land_marks_deleted_at";
CREATE INDEX `idx_land_marks_deleted_at` ON `land_marks`(`deleted_at`);
DROP INDEX IF EXISTS "idx_loans_deleted_at";
CREATE INDEX `idx_loans_deleted_at` ON `loans`(`deleted_at`);
DROP INDEX IF EXISTS "idx_locations_deleted_at";
CREATE INDEX `idx_locations_deleted_at` ON `locations`(`deleted_at`);
DROP INDEX IF EXISTS "idx_oil_changes_deleted_at";
CREATE INDEX `idx_oil_changes_deleted_at` ON `oil_changes`(`deleted_at`);
DROP INDEX IF EXISTS "idx_other_routes_deleted_at";
CREATE INDEX `idx_other_routes_deleted_at` ON `other_routes`(`deleted_at`);
DROP INDEX IF EXISTS "idx_petro_app_records_deleted_at";
CREATE INDEX `idx_petro_app_records_deleted_at` ON `petro_app_records`(`deleted_at`);
DROP INDEX IF EXISTS "idx_petro_app_stations_deleted_at";
CREATE INDEX `idx_petro_app_stations_deleted_at` ON `petro_app_stations`(`deleted_at`);
DROP INDEX IF EXISTS "idx_route_points_deleted_at";
CREATE INDEX `idx_route_points_deleted_at` ON `route_points`(`deleted_at`);
DROP INDEX IF EXISTS "idx_salaries_deleted_at";
CREATE INDEX `idx_salaries_deleted_at` ON `salaries`(`deleted_at`);
DROP INDEX IF EXISTS "idx_services_deleted_at";
CREATE INDEX `idx_services_deleted_at` ON `services`(`deleted_at`);
DROP INDEX IF EXISTS "idx_speed_alerts_deleted_at";
CREATE INDEX `idx_speed_alerts_deleted_at` ON `speed_alerts`(`deleted_at`);
DROP INDEX IF EXISTS "idx_speed_alerts_hash";
CREATE UNIQUE INDEX `idx_speed_alerts_hash` ON `speed_alerts`(`hash`);
DROP INDEX IF EXISTS "idx_taqa_routes_deleted_at";
CREATE INDEX `idx_taqa_routes_deleted_at` ON `taqa_routes`(`deleted_at`);
DROP INDEX IF EXISTS "idx_terminals_deleted_at";
CREATE INDEX `idx_terminals_deleted_at` ON `terminals`(`deleted_at`);
DROP INDEX IF EXISTS "idx_tire_positions_deleted_at";
CREATE INDEX `idx_tire_positions_deleted_at` ON `tire_positions`(`deleted_at`);
DROP INDEX IF EXISTS "idx_tires_deleted_at";
CREATE INDEX `idx_tires_deleted_at` ON `tires`(`deleted_at`);
DROP INDEX IF EXISTS "idx_trip_structs_deleted_at";
CREATE INDEX `idx_trip_structs_deleted_at` ON `trip_structs`(`deleted_at`);
DROP INDEX IF EXISTS "idx_trip_summaries_deleted_at";
CREATE INDEX `idx_trip_summaries_deleted_at` ON `trip_summaries`(`deleted_at`);
DROP INDEX IF EXISTS "idx_trips_deleted_at";
CREATE INDEX `idx_trips_deleted_at` ON `trips`(`deleted_at`);
DROP INDEX IF EXISTS "idx_trucks_deleted_at";
CREATE INDEX `idx_trucks_deleted_at` ON `trucks`(`deleted_at`);
DROP INDEX IF EXISTS "idx_trucks_truck_no";
CREATE UNIQUE INDEX `idx_trucks_truck_no` ON `trucks`(`truck_no`);
DROP INDEX IF EXISTS "idx_vendor_expenses_deleted_at";
CREATE INDEX `idx_vendor_expenses_deleted_at` ON `vendor_expenses`(`deleted_at`);
DROP INDEX IF EXISTS "idx_vendor_expenses_vendor_id";
CREATE INDEX `idx_vendor_expenses_vendor_id` ON `vendor_expenses`(`vendor_id`);
DROP INDEX IF EXISTS "idx_vendor_transactions_date";
CREATE INDEX `idx_vendor_transactions_date` ON `vendor_transactions`(`date`);
DROP INDEX IF EXISTS "idx_vendor_transactions_deleted_at";
CREATE INDEX `idx_vendor_transactions_deleted_at` ON `vendor_transactions`(`deleted_at`);
DROP INDEX IF EXISTS "idx_vendor_transactions_vendor_id";
CREATE INDEX `idx_vendor_transactions_vendor_id` ON `vendor_transactions`(`vendor_id`);
DROP INDEX IF EXISTS "idx_vendors_deleted_at";
CREATE INDEX `idx_vendors_deleted_at` ON `vendors`(`deleted_at`);
DROP INDEX IF EXISTS "idx_vendors_name";
CREATE UNIQUE INDEX `idx_vendors_name` ON `vendors`(`name`);
COMMIT;
